import React, { Component } from "react";

import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import {UserOutlined} from "@ant-design/icons"
class SideMenuLeft extends Component {
  state = {};

  render() {
    return (
      <Layout>
        <Row>
          <Col span={4}>
            <ul className="ul">

              <li className="li"> 
              <UserOutlined /> <a href ="/">About</a>
              </li>
              <li className="li">
                <a href ="/">Devloper</a>
              </li>
              <li className="li">
                <a href ="/">Career</a>
              </li>
              <li className="li">
                <a href ="/">More</a>
              </li>
              <li className="li">
                <a href ="/">Help</a>
              </li>
            </ul>
          </Col>
        </Row>
      </Layout>
    );
  }
}

export default SideMenuLeft;
